Defendant Christopher J Luzinski in court with attorney Eryn M Menden.  Timothy Suha appeared for the State of Wisconsin.
Defendant entered a plea of no contest to the Amended Information. Court conducted plea colloquy with defendant. Court found defendant guilty of the Amended Information.  

The Defendant was sentenced to the following:

WITHHELD SENTENCE;

TERM OF PROBATION:  12 MONTHS; Probation may be served in Racine County. 

CONDITIONS OF EXTENDED SUPERVISION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  
*No Use or Possession of alcohol, controlled substances or drug paraphernalia.
*Follow through with any treatment and/or counseling recommended by Agent;
*Maintain employment and/or combination of schooling 
*No operation of motor vehicle without a valid license.

COURT COSTS:  $243.00 to be paid as a condition probation;

CONDITION TIME:   30 DAYS  NON WORKING HOURS w/Standard Release Conditions; STAYED.

If all conditions have been met, then probation may be terminated after 6 months.
